  const showPopUp = () => {
    handleState(true);
  };

  return (
    <section className="sidebar">
      <addButton onClick={showPopUp}>추가</addButton>
      {data.map(info => {
        return(<span key={info.title}>{info.title}</span>);
      })}
    </section>
  );
}

export default Sidebar;
